import React from "react";

const HPBoulders = () => {
    return (
        <div className="hpboulders">
            <h1>Harry Potter Boulders</h1>
            <div className="info"></div>
            <br />
            <h3>Description: </h3>
                <p></p>
            <br />
            <h3>Location: </h3>
                <p>After parking, walk south downhill next to the road. Look for a 20ft black and white striped boulder through the trees at eye level.</p>
            <br />
            <h3>Boulders: </h3>
                <ul>
                    <li>Zebra Boulder Stand (v4)</li>
                    <li>Zebra Boulder Sit (v7)</li>
                </ul>
        </div>
    );
}

export default HPBoulders;
